import React, { useState, useEffect } from 'react';
import { Clock, Calendar, BookOpen, TrendingUp, Bell, Award, ChevronRight, Play, Users, FileText, Star } from 'lucide-react';

const DashboardContent = () => {
  const navigate = (path, options = {}) => {
    console.log(`Navigating to: ${path}`, options);
    alert(`Navigation to: ${path}`);
  };

  const [currentTime, setCurrentTime] = useState(new Date());
  const [greeting, setGreeting] = useState('');
  const [showNotifications, setShowNotifications] = useState(false);

  useEffect(() => {
    const timer = setInterval(() => setCurrentTime(new Date()), 1000);

    const hour = new Date().getHours();
    if (hour < 12) setGreeting('Good Morning');
    else if (hour < 17) setGreeting('Good Afternoon');
    else setGreeting('Good Evening');

    return () => clearInterval(timer);
  }, []);

  const formatTime = (date) => {
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  const quickActions = [
    { icon: BookOpen, label: 'Browse Courses', color: 'bg-blue-500', onClick: () => navigate('/student/courses') },
    { icon: FileText, label: 'Assignments', color: 'bg-green-500', onClick: () => navigate('/student/assignments') },
    { icon: Users, label: 'Study Groups', color: 'bg-purple-500', onClick: () => navigate('/student/groups') },
    { icon: Award, label: 'Achievements', color: 'bg-yellow-500', onClick: () => navigate('/student/achievements') }
  ];

  return (
    <div className="w-full min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 p-4 sm:p-6">
      <div className="w-full space-y-6">

        {/* Header Section */}
        <div className="w-full bg-white rounded-xl sm:rounded-2xl shadow-lg p-4 sm:p-6 bg-gradient-to-r from-blue-600 to-indigo-700 text-white">
          <div className="flex flex-col sm:flex-row justify-between items-start sm:items-center gap-4">
            <div>
              <h1 className="text-2xl sm:text-3xl font-bold mb-2">{greeting}, Student!</h1>
              <p className="text-blue-100 flex items-center gap-2 text-sm sm:text-base">
                <Clock className="w-4 h-4" />
                {formatTime(currentTime)} â€¢ {currentTime.toLocaleDateString()}
              </p>
            </div>
            <div className="relative">
              <button
                onClick={() => setShowNotifications(!showNotifications)}
                className="relative p-3 bg-white/20 rounded-full hover:bg-white/30 transition-colors"
              >
                <Bell className="w-6 h-6" />
                <span className="absolute -top-1 -right-1 bg-red-500 text-white text-xs rounded-full w-5 h-5 flex items-center justify-center">
                  3
                </span>
              </button>
              {showNotifications && (
                <div className="absolute right-0 mt-2 w-72 sm:w-80 bg-white rounded-lg shadow-xl z-10 text-gray-800">
                  <div className="p-4 border-b">
                    <h3 className="font-semibold">Notifications</h3>
                  </div>
                  <div className="p-4 space-y-3">
                    <div className="flex items-start gap-3 p-2 hover:bg-gray-50 rounded">
                      <div className="w-2 h-2 bg-red-500 rounded-full mt-2"></div>
                      <div>
                        <p className="text-sm font-medium">Assignment Due Soon</p>
                        <p className="text-xs text-gray-600">Computer Vision Project - 1 day left</p>
                      </div>
                    </div>
                    <div className="flex items-start gap-3 p-2 hover:bg-gray-50 rounded">
                      <div className="w-2 h-2 bg-blue-500 rounded-full mt-2"></div>
                      <div>
                        <p className="text-sm font-medium">Class Starting Soon</p>
                        <p className="text-xs text-gray-600">Machine Learning in 30 minutes</p>
                      </div>
                    </div>
                    <div className="flex items-start gap-3 p-2 hover:bg-gray-50 rounded">
                      <div className="w-2 h-2 bg-green-500 rounded-full mt-2"></div>
                      <div>
                        <p className="text-sm font-medium">Grade Posted</p>
                        <p className="text-xs text-gray-600">ML Quiz - 95% (A)</p>
                      </div>
                    </div>
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="w-full grid grid-cols-2 sm:grid-cols-4 gap-3 sm:gap-4">
          {quickActions.map((action, index) => (
            <button
              key={index}
              onClick={action.onClick}
              className="w-full bg-white rounded-lg sm:rounded-xl shadow-md p-3 sm:p-4 hover:shadow-lg transition-all duration-300 hover:-translate-y-1 group"
            >
              <div className={`${action.color} w-10 h-10 sm:w-12 sm:h-12 rounded-lg flex items-center justify-center mb-2 sm:mb-3 group-hover:scale-110 transition-transform mx-auto`}>
                <action.icon className="w-5 h-5 sm:w-6 sm:h-6 text-white" />
              </div>
              <p className="font-medium text-gray-800 text-sm sm:text-base">{action.label}</p>
            </button>
          ))}
        </div>

        {/* Add additional sections here */}

      </div>
    </div>
  );
};

export default DashboardContent;
